import React, { useState } from 'react';
import axios from 'axios';
import logo from '../logo.svg';

const Quote = props => {

  const handleAddFavourite = props => {
    props.setFavouriteList(favouriteList => [...favouriteList, props]);
  }

  return (
    <div>
      <h1>{props.anime}</h1>
      <h1>{props.character}</h1>
      <h1>{props.quote}</h1>
      <button onClick={handleAddFavourite}>add to favourite</button>
    </div>
  )
}

export default Quote;
